import React, { useState, useEffect, useContext, Fragment } from 'react';
import SensorContext from '../../../context/sensor/sensorContext';
import SensorList from '../SensorList';
import HVACSysModule from '../HVACSysModule';
import { MDBTable,MDBTableBody,MDBRow,MDBCol,MDBCard, MDBCardTitle } from 'mdbreact';

import { 
  CTW_A_TEMP1,CTW_A_TEMP2,CTW_A_FLOWRATE,CTW_A_ELECTPWR, 
  CTW_B_TEMP1,CTW_B_TEMP2,CTW_B_FLOWRATE,CTW_B_ELECTPWR,
  WCPU_A_TEMP1, WCPU_A_TEMP2, WCPU_A_FLOWRATE, WCPU_A_ELECTPWR,
  WCPU_B_TEMP1, WCPU_B_TEMP2, WCPU_B_FLOWRATE, WCPU_B_ELECTPWR,
  AHU_A_TEMP1,AHU_A_TEMP2,AHU_A_FLOWRATE,AHU_A_ELECTPWR,
  AHU_B_TEMP1,AHU_B_TEMP2,AHU_B_FLOWRATE,AHU_B_ELECTPWR, 
  CHILLER_A_CH_TEMP1, CHILLER_A_CH_TEMP2, CHILLER_A_CH_FLOWRATE,
  CHILLER_A_CW_TEMP1, CHILLER_A_CW_TEMP2, CHILLER_A_CW_FLOWRATE,
  CHILLER_B_CH_TEMP1, CHILLER_B_CH_TEMP2, CHILLER_B_CH_FLOWRATE,
  CHILLER_B_CW_TEMP1, CHILLER_B_CW_TEMP2, CHILLER_B_CW_FLOWRATE,
  CHILLER_A_ELECTPWR, CHILLER_B_ELECTPWR
} from '../../types';

// https://jpg-svg.com/#
// https://imageresizer.com/transparent-background
// https://picsvg.com/
// https://products.aspose.app/svg/en/image-vectorization/view
// REFERENCE SVG DATA FROM 
// '../components/svg/TDK_ISOVIEW.svg'

function TDK_PlanVIEW({ model, color, sensorsData, systemComponent, handleComponetSelection,title }) {
    const [compSensors,setCOMPSensors] = useState([])

    const sensorContext = useContext(SensorContext);
    const { sensors, getSensors } = sensorContext;
    // --------------
    useEffect(()=>{
        if (sensors === null) getSensors(30,null,null);
        abstactCOMPTSensor(systemComponent);
    },[systemComponent])
    // ---------------------------
    const abstactCOMPTSensor = (_systemComponent) => {
        if (sensors === null) 
        return;
        if (_systemComponent === null)
        return;
        // -----------------
        // ABSTRACT WISENSOR
        // -----------------
        // -------------------
        let _COMPSensors = [];
        let _sLabels = [];
        let _airflowDatas = [];
        sensors.map( sensor => {
            if (sensor.location === _systemComponent) {
                _COMPSensors.push(sensor);
                _sLabels.push(sensor.name);
            }
        })
        setCOMPSensors(_COMPSensors);
        // setSensorLabels(_sLabels);
        // setAFlowData(_airflowDatas);
    }
      // --------------
    function handleClick (event) {
        let sysName = event.target.id;
        if (handleComponetSelection !== null) handleComponetSelection(sysName);
    }
    function bgColor (strKEY) {
        return (strKEY === systemComponent ? 'red' : 'black')
    }
    // --------------
    const componentNames = {
        sysCHILLER : 'CHILLER',
        sysAHU : 'AHU',
        sysWCPU : 'WCPU',
        sysCTW : "CTW",
        pumpCHILLER : "CH PUMP",
        pumpCTW : "CTW PUMP",
        pumpAHU : "AHU PUMP"
    }
    function getwidth() {
        let width = window.innerWidth > 465 ? '800' : '320';
        return width;
    }
    // --------------------------------------------
    // fill='green' stroke='black' stroke-width='1'
    // width="645" height="459" viewBox="0 0 645 459"
    // --------------------------------------------
    return (
			<MDBRow center>
				<MDBCol md="8">
				<MDBCard className="p-1" style={{width:"auto"}} >
					<h4 onClick={handleClick} >{title}:{systemComponent}</h4>
					{/* width="700" height="400"  */}
					<svg viewBox="0 0 700 400" preserveAspectRatio="xMidYMid meet" >
                        <g transform="translate(20.0,380.0) scale(1.0,-1.0)" fill={color}>
                                {model === '5' && getModel5(sensorsData,componentNames,handleClick,bgColor)}
                        </g>
                        {/* COOLING TOWER  */}
                        <g transform="translate(50.0,90.0)" >
                                <rect x="-30" y="0" width="30" height="20" fill='yellow' />
                                <text x="-25" y="15" fill="black" font-size="0.8em" name='CTWA_T1' id='CTWA_T1' onClick={handleClick} >{sensorsData && sensorsData[CTW_A_TEMP1].reading}</text>
                                <rect x="60" y="0" width="40" height="20" fill='green' />
                                <text x="65" y="15" fill="white" font-size="0.8em" name='CTWA_T2' id='CTWA_T2' onClick={handleClick} >{sensorsData && sensorsData[CTW_A_TEMP2].reading}</text>

                                <rect x="0" y="20" width="60" height="20" fill={bgColor('CTW')} />
                                <text x="5" y="35" fill="WHITE" font-size="0.8em" name='CTW' id='CTW' onClick={handleClick} >{componentNames.sysCTW}</text>

                                <rect x="-30" y="90" width="40" height="20" fill='yellow' />
                                <text x="-25" y="105" fill="black" font-size="0.8em" name='CTWB_T1' id='CTWB_T1' onClick={handleClick} >{sensorsData && sensorsData[CTW_B_TEMP1].reading}</text>
                                <rect x="60" y="70" width="40" height="20" fill='green' />
                                <text x="65" y="85" fill="white" font-size="0.8em" name='CTWB_T1' id='CTWB_T1' onClick={handleClick} >{sensorsData && sensorsData[CTW_B_TEMP2].reading}</text>
                        </g>
                        {/* COOLING TOWER PUMP */}
                        <g transform="translate(40.0,290.0)" >
                                <rect x="0" y="10" width="80" height="20" fill={bgColor('PMP_CTW')} />
                                <text x="5" y="25" fill="WHITE" font-size="0.8em" name='PMP_CW' id='PMP_CW' onClick={handleClick} >{componentNames.pumpCTW}</text>
                        </g>
                        {/* CHILLER */}
                        <g transform="translate(320.0,275.0)" >
                                <rect x="-55" y="-10" width="40" height="20" fill='yellow' />
                                <text x="-50" y="5" fill="black" font-size="0.8em" name='CHA_T1' id='CHA_T1' onClick={handleClick} >{sensorsData && sensorsData[CHILLER_A_CW_TEMP1].reading}</text>
                                <rect x="-50" y="70" width="40" height="20" fill='green' />
                                <text x="-45" y="85" fill="white" font-size="0.8em" name='CHA_T2' id='CHA_T2' onClick={handleClick} >{sensorsData && sensorsData[CHILLER_A_CW_TEMP2].reading}</text>
                                                        
                                <rect x="0" y="55" width="40" height="20" fill='blue' />
                                <text x="5" y="70" fill="white" font-size="0.8em" name='CHA_T1' id='CHA_T1' onClick={handleClick} >{sensorsData && sensorsData[CHILLER_A_CH_TEMP1].reading}</text>
                                <rect x="-5" y="-40" width="40" height="20" fill='red' />
                                <text x="0" y="-25" fill="white" font-size="0.8em" name='CHA_T2' id='CHA_T2' onClick={handleClick} >{sensorsData && sensorsData[CHILLER_A_CH_TEMP2].reading}</text>

                                <rect x="-80" y="30" width="80" height="20" fill={bgColor('CHILLER')} />
                                <text x="-75" y="45" fill="WHITE" font-size="0.8em" name='CHILLER' id='CHILLER' onClick={handleClick} >{componentNames.sysCHILLER}</text>

                                <rect x="120" y="50" width="40" height="20" fill='blue' />
                                <text x="125" y="65" fill="white" font-size="0.8em" name='CHB_T1' id='CHB_T1' onClick={handleClick} >{sensorsData && sensorsData[CHILLER_B_CH_TEMP1].reading}</text>
                                <rect x="60" y="-20" width="40" height="20" fill='red' />
                                <text x="65" y="-5" fill="white" font-size="0.8em" name='CHB_T1' id='CHB_T1' onClick={handleClick} >{sensorsData && sensorsData[CHILLER_B_CH_TEMP2].reading}</text>
                                <rect x="70" y="70" width="40" height="20" fill='green' />
                                <text x="75" y="85" fill="WHITE" font-size="0.8em" name='CHB_T1' id='CHB_T1' onClick={handleClick} >{sensorsData && sensorsData[CHILLER_B_CW_TEMP1].reading}</text>
                                <rect x="20" y="0" width="40" height="20" fill='yellow' />
                                <text x="25" y="15" fill="black" font-size="0.8em" name='CHB_T1' id='CHB_T1' onClick={handleClick} >{sensorsData && sensorsData[CHILLER_B_CW_TEMP2].reading}</text>
                        </g>
                        {/* CHILLER PUMP */}
                        <g transform="translate(300.0,70.0)" >
                                <rect x="0" y="10" width="80" height="20" fill={bgColor('PMP_CHILLER')} />
                                <text x="5" y="25" fill="WHITE" font-size="0.8em" name='PMP_CHILLER' id='PMP_CHILLER' onClick={handleClick} >{componentNames.pumpCHILLER}</text>
                        </g>
                        {/* AIR HANDLING UNITS */}
                        <g transform="translate(540.0,90.0)" >
                                <rect x="-105" y="-20" width="40" height="20" fill='red' />
                                <text x="-100" y="-5" fill="white" font-size="0.8em" name='AHUA_T1' id='AHUA_T1' onClick={handleClick} >{sensorsData && sensorsData[AHU_A_TEMP2].reading}</text>
                                <rect x="115" y="-20" width="40" height="20" fill='blue' />
                                <text x="120" y="-5" fill="white" font-size="0.8em" name='AHUA_T2' id='AHUA_T2' onClick={handleClick} >{sensorsData && sensorsData[AHU_A_TEMP1].reading}</text>

                                <rect x="0" y="30" width="80" height="20" fill={bgColor('AHU')} />
                                <text x="5" y="45" fill="WHITE" font-size="0.8em" name='AHU' id='AHU' onClick={handleClick} >{componentNames.sysAHU}</text>

                                <rect x="-105" y="70" width="40" height="20" fill='red' />
                                <text x="-100" y="85" fill="WHITE" font-size="0.8em" name='AHUB_T1' id='AHUB_T1' onClick={handleClick} >{sensorsData && sensorsData[AHU_B_TEMP2].reading}</text>
                                <rect x="115" y="70" width="40" height="20" fill='blue' />
                                <text x="120" y="85" fill="white" font-size="0.8em" name='AHUB_T1' id='AHUB_T1' onClick={handleClick} >{sensorsData && sensorsData[AHU_B_TEMP1].reading}</text>                
                        </g>
                        {/* AIR HANDLING UNITS PUMPS */}
                        <g transform="translate(580.0,280.0)" >
                                <rect x="0" y="10" width="80" height="20" fill={bgColor('PMP_AHU')} />
                                <text x="5" y="25" fill="WHITE" font-size="0.8em" name='PMP_AHU' id='PMP_AHU' onClick={handleClick}>
                                {componentNames.pumpAHU}</text>
                        </g>
                        {/* WATER COOLING PACK UNITS */}
                        <g transform="translate(220.0,60.0)" >
                                <rect x="-40" y="-10" width="40" height="20" fill='green' />
                                <text x="-35" y="5" fill="white" font-size="0.8em" name='WCPUA_T1' id='WCPUA_T1' onClick={handleClick} >{sensorsData && sensorsData[WCPU_A_TEMP1].reading}</text>
                                <rect x="-20" y="10" width="40" height="20" fill='yellow' />
                                <text x="-15" y="25" fill="black" font-size="0.8em" name='WCPUA_T2' id='WCPUA_T2' onClick={handleClick} >{sensorsData && sensorsData[WCPU_A_TEMP2].reading}</text>

                                <rect x="0" y="-40" width="80" height="20" fill={bgColor('WCPU')} />
                                <text x="5" y="-25" fill="WHITE" font-size="0.8em" name='WCPU' id='WCPU' onClick={handleClick} >{componentNames.sysWCPU}</text>

                                <rect x="0" y="60" width="40" height="20" fill='green' />
                                <text x="5" y="75" fill="WHITE" font-size="0.8em" name='WCPUB_T1' id='WCPUB_T1' onClick={handleClick} >{sensorsData && sensorsData[WCPU_B_TEMP1].reading}</text>
                                <rect x="0" y="85" width="40" height="20" fill='yellow' />
                                <text x="5" y="100" fill="black" font-size="0.8em" name='WCPUB_T1' id='WCPUB_T1' onClick={handleClick} >{sensorsData && sensorsData[WCPU_B_TEMP2].reading}</text>
                        </g>
                    </svg>
				</MDBCard>
				</MDBCol>
				<MDBCol md="4">
				<MDBCard className="p-3 m-1" style={{ width: "22rem" }}>
					<MDBCardTitle>{systemComponent}</MDBCardTitle>
					<MDBTable striped small>
						<MDBTableBody>
						{
							compSensors && compSensors.map( (sensor,index) => { return (<SensorList sensor={sensor} index={index} />)})
						}
						</MDBTableBody>
					</MDBTable>
				</MDBCard>
				</MDBCol>
				<div>
						<HVACSysModule sensorsData={sensorsData} systemComponent={systemComponent} />
				</div>
			</MDBRow>
    )
}


